import './Volunteer.css';
import emailjs from "emailjs-com";

function CheckFormValidity(FormArray)
{
    for (var i = 0; i < FormArray.length; i++)
    {
        if (FormArray[i] == "" && (i != 3 && i != 4))
        {
            return false;
        }
    }
    return true;
}

function HandleRegistration(e, FormArray)
{
    if (!CheckFormValidity(FormArray))
    {
        alert("Please fill all required fields")
        return;
    }

    emailjs.sendForm("service_twqspf9", "template_gmiuteb", e.target, "user_U5kIH4D9VxCVIrMGw88DG").then(
        (result) => null
    )
}

